import React from 'react';

function Home() {

    const homeBodyContaier = {
        padding: "10px",
        marginTop: "auto",
        width: "50%",
        color: green
      };

    return (
    <div style={homeBodyContaier}>
        <h2 style={{fontWeight: "900"}}>HELLO, MY NAME IS</h2>
        <h1 style={{fontWeight: "300"}}>Lauren Cameron</h1>
    </div>
    )};

  export default Home;
